def draw_maze(maze):
    for y in range(HEIGHT):
        for x in range(WIDTH):
            rect = pygame.Rect(x * CELL_SIZE, y * CELL_SIZE, CELL_SIZE, CELL_SIZE)
            if maze[y][x] == 0:
                pygame.draw.rect(screen, (0, 0, 0), rect)
            else:
                pygame.draw.rect(screen, (255, 255, 255), rect)
                
                
                
def bfs(maze):
    starting_point = (0,0)

    isMarked = set()
    queue = []
    queue.append(starting_point)
    isMarked.add(starting_point)
    moves = ["up", "down", "right", "left"]
    edgeTo = {}


    while queue:
        x,y = queue.pop(0)
        
        for move in moves:
            
            if move == "up":
                temp_y = y - 1
                if (temp_y) >= 0:
                    if (maze[temp_y][x] == 1):
                        if (x,temp_y) not in isMarked:
                            queue.append((x,temp_y))
                            isMarked.add((x,temp_y))
                            edgeTo[(x,temp_y)] = (x,y)
            
            if move == "down":
                temp_y = y + 1
                if (temp_y) <= len(maze) - 1:
                    if (maze[temp_y][x] == 1):
                        if (x,temp_y) not in isMarked:
                            queue.append((x,temp_y))
                            isMarked.add((x,temp_y))
                            edgeTo[(x,temp_y)] = (x,y)
                        
            if move == "right":
                temp_x = x + 1
                if temp_x <= len(maze) - 1:
                    if (maze[y][temp_x] == 1):
                        if (temp_x,y) not in isMarked:
                            queue.append((temp_x,y))
                            isMarked.add((temp_x,y))
                            edgeTo[(temp_x,y)] = (x,y)
                    
            if move == "left":
                temp_x = x - 1
                if temp_x >= 0:
                    if (maze[y][temp_x] == 1):
                        if (temp_x,y) not in isMarked:
                            queue.append((temp_x,y))
                            isMarked.add((temp_x,y))
                            edgeTo[(temp_x,y)] = (x,y)
                            
    return edgeTo


def backtrack_sol(edgeTo):
    starting_pos = (0,0)
    temp_pos = (WIDTH -1, HEIGHT - 1)
    sol_path = []
    sol_path.append(temp_pos)
    
    while temp_pos != starting_pos:
        come_from = edgeTo[temp_pos]
        sol_path.append(come_from)
        temp_pos = come_from
        
    return sol_path
    
def path_visualizer(sol_path):
    for pos in sol_path:
        x,y = pos
        rect = pygame.Rect(x * CELL_SIZE, y * CELL_SIZE, CELL_SIZE, CELL_SIZE)
        pygame.draw.rect(screen, (0, 128, 0), rect)
    
    
    
    
    
running = True
player_pos = (0,0)
maze = create_maze()
draw_maze(maze)

while running:

    # pygame.draw.rect(screen, (0, 255, 0), pygame.Rect(player_pos[0] * CELL_SIZE, player_pos[1] * CELL_SIZE, CELL_SIZE, CELL_SIZE))

    for event in pygame.event.get():
        if event.type == pygame.QUIT:
            running = False
        elif event.type == pygame.KEYDOWN:
            if event.key == pygame.K_DOWN:
                edgeTo = bfs(maze)
                sol_path = backtrack_sol(edgeTo)
                path_visualizer(sol_path)
                
            


    pygame.display.flip()

pygame.quit()
